import { authConstants } from "../actions/constants"

const initialState = {
    token: null,
    user: {
        firstName: '',
        lasstName: '',
        email: '',
        picture: ''
    },
    authenticate: false,
    authenticating: false
}

const authReducer = (state = initialState, action) => {
    switch (action.type) {
        case authConstants.LOGIN_REQUEST:
            return { ...state, authenticating: true }
        default:
            return state
    }
}

export default authReducer
